            <div class='text-center mt-5'>
                <h4 class='font-weight-bold'>Entrepreneurship CELL –DMCE</h4>
                <h5 class='font-weight-bold'>Coordinator: Prof Sameer Ekbote </h5>
                <p class='text-justify'>
                    The Entrepreneurship CELL -DMCE headed by T and P officer Prof. Sameer Ekbote works hard throughout the year to invoke and imbibe the spirit of entrepreneurship within all the students.
                    In the process of identifying, nurturing, training and establishing start-ups, E-CELL is involved in a wide range of activities.

                    It connects students with solid entrepreneurial skills and the people who are interested in entrepreneurship to work together and increase the start-up community.

                    We nurture and encourage various entrepreneurial ideas brought up by the students. 

                    Our committee has been organizing a number of events to inculcate the idea of Entrepreneurship in young minds, developing skills required for a successful start-up, creating a platform for people to showcase their skills and encouraging people to take business as their career path.

                    Our Flagship event named “ENSPIRE” is one of our main attractions and is held every year. It includes speaker sessions by dynamic and successful entrepreneurs, aimed to guide aspirants towards entrepreneurship by entrepreneurs themselves.

                    E-CELL provides a platform for the students to showcase their skills through various workshops and competitions and even spreads awareness through our social media platforms by bringing in new social media series for entrepreneurship.

                    Every year we take part in National Entrepreneurship Challenge (NEC) organized by IIT Bombay wherein we are given tasks and our team members work collectively to complete them. <strong>We have also emerged victorious by bagging 1st prize in basic track in the year “2018“.</strong>

                    E-CELL has been successfully inspiring bright minds since August 2014 with an able team working effortlessly in organizing all of the events.
                </p>
            </div>
